import React from "react";

export const BookSearch = () => {
  return (
    <div class="container">
      <div>
        <form>
          <div class="switch">
            <label>
              Off
              <input type="checkbox" />
              <span class="lever"></span>
              On
            </label>
          </div>
          <div class="input-field">
            <input id="search" type="search" />
            <button class="btn small blue">Search</button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default BookSearch;
